instance.peoplecode_text:
/**
* Executes the CCTC Method using the provided Args and sets result field as dataDelim separated string
* @company CCC Tech Center
* @author Paul Weatherby
* @version 2.9.0
* @created 12/19/2018
* @updated 5/2/2019
*/

Local string &packageName = CCTC_RPC_REC.CCTC_RPC_PACKAGE;
Local string &className = CCTC_RPC_REC.CCTC_RPC_CLASS;
Local string &methodName = CCTC_RPC_REC.CCTC_RPC_METHOD;
Local string &dataDelimiter = CCTC_RPC_REC.CCTC_RPC_DATADELIM;
Local string &methodArgs = CCTC_RPC_REC.CCTC_RPC_ARGS;

rem First do some security checks- We only run CCTC methods;
If Substring(&packageName, 1, 5) <> "CCTC_" Then
   &packageName = "CCTC_" | &packageName;
End-If;

If Substring(&className, 1, 5) <> "CCTC_" Then
   &className = "CCTC_" | &className;
End-If;

rem Then some basic parameter validation;
If None(&methodName) Then
   Error "No Method Name found";
End-If;

If None(&dataDelimiter) Then
   &dataDelimiter = "?";
End-If;

rem Parse the methodArgs string into an array, if last value is blank,
   handle that by pushing an extra value since split will ignore it;
Local array of string &SParams = Split(&methodArgs, &dataDelimiter);
If All(&methodArgs) And
      Substring(&methodArgs, Len(&methodArgs), 1) = &dataDelimiter Then
   &SParams.Push(" ");
End-If;

rem Convert the string array to an any array cause it helps
   when trying to bind sql placeholders later on in each cctc method;
Local array of any &AParams = CreateArrayAny();
Local number &i = 1;
For &i = 1 To &SParams.Len
   &AParams.Push(&SParams [&i]);
End-For;

rem get the package/class that contains the method to execute;
Local object &classObject = CreateObject(&packageName | ":" | &className);


rem execute the method and capture results.
    Note: the signature of the method must be in the form:
    method SomeMethodName(&SomeParamName As Array of Any) Returns Array of Array of Any;
Local array of array of any &AAResult = ObjectDoMethod(&classObject, &methodName, &AParams);

rem Convert the 2d array to a DataDelimited string
    Note: We wish Peoplesoft CI could support array types across to java, but alas they dont,
    so we are stuck converting back and forth string to array and array to string;
Local string &SResult = "";
If &AAResult <> Null And
      &AAResult.Len > 0 Then
   Local number &j = 1;
   For &i = 1 To &AAResult.Len
      For &j = 1 To &AAResult [&i].Len
         &SResult = &SResult | &dataDelimiter | &AAResult [&i][&j]
      End-For;
   End-For;
   &SResult = Substring(&SResult, 2, Len(&SResult) - 1);
End-If;

rem Save the result and done;
CCTC_RPC_REC.CCTC_RPC_RESULT = &SResult;
